import React, { useState, useEffect } from 'react';
import './App.css';
import ProcessPanel from './components/ProcessPanel';
import SearchPanel from './components/SearchPanel';
import ResultsGrid from './components/ResultsGrid';
import { 
  FiSearch, FiImage, FiSun, FiMoon, FiMenu, FiX, 
  FiChevronLeft, FiChevronRight, FiHome, 
  FiGithub, FiHelpCircle, FiDatabase, FiCpu, FiLayers,
  FiExternalLink
} from 'react-icons/fi';

function App() {
  const [activeTab, setActiveTab] = useState('process');
  const [metadata, setMetadata] = useState(null);
  const [error, setError] = useState(null);
  const [searchResults, setSearchResults] = useState([]);
  const [theme, setTheme] = useState('dark');
  const [sidebarCollapsed, setSidebarCollapsed] = useState(false);
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  // Theme toggle
  useEffect(() => {
    const savedTheme = localStorage.getItem('theme') || 'dark';
    setTheme(savedTheme);
    document.body.setAttribute('data-theme', savedTheme);
    
    // Load sidebar state
    const savedSidebar = localStorage.getItem('sidebarCollapsed');
    if (savedSidebar) {
      setSidebarCollapsed(savedSidebar === 'true');
    }
  }, []);

  const toggleTheme = () => {
    const newTheme = theme === 'dark' ? 'light' : 'dark';
    setTheme(newTheme);
    document.body.setAttribute('data-theme', newTheme);
    localStorage.setItem('theme', newTheme);
  };

  const toggleSidebar = () => {
    const newState = !sidebarCollapsed;
    setSidebarCollapsed(newState);
    localStorage.setItem('sidebarCollapsed', newState.toString());
  };

  // Generate particles
  useEffect(() => {
    const particlesBg = document.getElementById('particlesBg');
    if (particlesBg && particlesBg.children.length === 0) {
      for (let i = 0; i < 50; i++) {
        const particle = document.createElement('div');
        particle.className = 'particle';
        particle.style.left = Math.random() * 100 + '%';
        particle.style.animationDelay = Math.random() * 20 + 's';
        particle.style.animationDuration = (15 + Math.random() * 10) + 's';
        particlesBg.appendChild(particle);
      }
    }
  }, []);

  const handleProcessComplete = (newMetadata) => {
    setMetadata(newMetadata);
    setSearchResults([]);
    setError(null);
    setTimeout(() => setActiveTab('search'), 500);
  };

  const handleLoadMetadata = (loadedMetadata) => {
    setMetadata(loadedMetadata);
    setSearchResults([]);
    setError(null);
    setTimeout(() => setActiveTab('search'), 500);
  };

  const handleSearch = (results) => {
    setSearchResults(results);
  };

  const handleError = (errorMsg) => {
    setError(errorMsg);
  };

  return (
    <div className={`App ${sidebarCollapsed ? 'sidebar-collapsed' : ''}`}>
      {/* Particles Background */}
      <div className="particles-bg" id="particlesBg"></div>

      {/* Gradient Background Orbs */}
      <div className="gradient-bg">
        <div className="orb orb-1"></div>
        <div className="orb orb-2"></div>
        <div className="orb orb-3"></div>
      </div>

      {/* Sidebar */}
      <aside className={`sidebar ${sidebarCollapsed ? 'collapsed' : ''} ${mobileMenuOpen ? 'mobile-open' : ''}`}>
        {/* Sidebar Header */}
        <div className="sidebar-header">
          <a href="https://satyamkumarcode.com/index.html#home" className="sidebar-logo">
            <span className="logo-icon">SK</span>
            {!sidebarCollapsed && <span className="logo-text">Satyam Kumar</span>}
          </a>
          <button className="sidebar-toggle desktop-only" onClick={toggleSidebar}>
            {sidebarCollapsed ? <FiChevronRight /> : <FiChevronLeft />}
          </button>
        </div>

        {/* Main Navigation */}
        <nav className="sidebar-nav">
          <div className="nav-section">
            {!sidebarCollapsed && <span className="nav-section-title">Main</span>}
            <button 
              className={`sidebar-nav-item ${activeTab === 'process' ? 'active' : ''}`}
              onClick={() => { setActiveTab('process'); setMobileMenuOpen(false); }}
            >
              <FiImage className="nav-icon" />
              {!sidebarCollapsed && <span>Process Images</span>}
              {sidebarCollapsed && <span className="tooltip">Process Images</span>}
            </button>
            <button 
              className={`sidebar-nav-item ${activeTab === 'search' ? 'active' : ''} ${!metadata ? 'disabled' : ''}`}
              onClick={() => { if(metadata) { setActiveTab('search'); setMobileMenuOpen(false); } }}
              disabled={!metadata}
            >
              <FiSearch className="nav-icon" />
              {!sidebarCollapsed && <span>Search Objects</span>}
              {sidebarCollapsed && <span className="tooltip">Search Objects</span>}
            </button>
          </div>

          <div className="nav-section">
            {!sidebarCollapsed && <span className="nav-section-title">Info</span>}
            <div className="sidebar-nav-item info-item">
              <FiDatabase className="nav-icon" />
              {!sidebarCollapsed && (
                <div className="info-content">
                  <span>Dataset</span>
                  <small>{metadata ? `${metadata.total_images} images` : 'Not loaded'}</small>
                </div>
              )}
              {sidebarCollapsed && <span className="tooltip">{metadata ? `${metadata.total_images} images` : 'No dataset'}</span>}
            </div>
            <div className="sidebar-nav-item info-item">
              <FiCpu className="nav-icon" />
              {!sidebarCollapsed && (
                <div className="info-content">
                  <span>Model</span>
                  <small>YOLOv11</small>
                </div>
              )}
              {sidebarCollapsed && <span className="tooltip">YOLOv11</span>}
            </div>
            <div className="sidebar-nav-item info-item">
              <FiLayers className="nav-icon" />
              {!sidebarCollapsed && (
                <div className="info-content">
                  <span>Classes</span>
                  <small>80 COCO classes</small>
                </div>
              )}
              {sidebarCollapsed && <span className="tooltip">80 COCO classes</span>}
            </div>
          </div>

          <div className="nav-section">
            {!sidebarCollapsed && <span className="nav-section-title">Portfolio</span>}
            <a href="https://satyamkumarcode.com/index.html#home" className="sidebar-nav-item external">
              <FiHome className="nav-icon" />
              {!sidebarCollapsed && <span>Home</span>}
              {sidebarCollapsed && <span className="tooltip">Home</span>}
              {!sidebarCollapsed && <FiExternalLink className="external-icon" />}
            </a>
            <a href="https://satyamkumarcode.com/index.html#projects" className="sidebar-nav-item external">
              <FiLayers className="nav-icon" />
              {!sidebarCollapsed && <span>Projects</span>}
              {sidebarCollapsed && <span className="tooltip">Projects</span>}
              {!sidebarCollapsed && <FiExternalLink className="external-icon" />}
            </a>
            <a href="https://satyamkumarcode.com/index.html#contact" className="sidebar-nav-item external">
              <FiHelpCircle className="nav-icon" />
              {!sidebarCollapsed && <span>Contact</span>}
              {sidebarCollapsed && <span className="tooltip">Contact</span>}
              {!sidebarCollapsed && <FiExternalLink className="external-icon" />}
            </a>
            <a href="https://github.com/satyamkumarcode" className="sidebar-nav-item external" target="_blank" rel="noopener noreferrer">
              <FiGithub className="nav-icon" />
              {!sidebarCollapsed && <span>GitHub</span>}
              {sidebarCollapsed && <span className="tooltip">GitHub</span>}
              {!sidebarCollapsed && <FiExternalLink className="external-icon" />}
            </a>
          </div>
        </nav>

        {/* Sidebar Footer */}
        <div className="sidebar-footer">
          <button className="theme-toggle-sidebar" onClick={toggleTheme}>
            {theme === 'dark' ? <FiSun className="nav-icon" /> : <FiMoon className="nav-icon" />}
            {!sidebarCollapsed && <span>{theme === 'dark' ? 'Light Mode' : 'Dark Mode'}</span>}
            {sidebarCollapsed && <span className="tooltip">{theme === 'dark' ? 'Light Mode' : 'Dark Mode'}</span>}
          </button>
        </div>
      </aside>

      {/* Mobile Overlay */}
      {mobileMenuOpen && <div className="sidebar-overlay" onClick={() => setMobileMenuOpen(false)}></div>}

      {/* Main Content Area */}
      <div className="main-wrapper">
        {/* Top Header Bar */}
        <header className="top-header">
          <button className="mobile-menu-btn" onClick={() => setMobileMenuOpen(!mobileMenuOpen)}>
            {mobileMenuOpen ? <FiX /> : <FiMenu />}
          </button>
          
          <div className="header-content">
            <div className="header-title">
              <h1>
                {activeTab === 'process' ? 'üì∑ Process Images' : 'üîç Search Objects'}
              </h1>
              <p>
                {activeTab === 'process' 
                  ? 'Upload and process images with YOLOv11 object detection' 
                  : 'Search through detected objects in your image collection'}
              </p>
            </div>
          </div>

          <div className="header-actions">
            {metadata && (
              <div className="header-badge">
                <FiDatabase />
                <span>{metadata.total_images} images</span>
              </div>
            )}
          </div>
        </header>

        {/* Main Content */}
        <main className="main-content">
          {error && (
            <div className="error-banner">
              <p>‚ö†Ô∏è {error}</p>
              <button onClick={() => setError(null)}>√ó</button>
            </div>
          )}

          <div className="content-wrapper">
            {activeTab === 'process' && (
              <ProcessPanel
                onProcessComplete={handleProcessComplete}
                onLoadMetadata={handleLoadMetadata}
                onError={handleError}
              />
            )}

            {activeTab === 'search' && metadata && (
              <SearchPanel
                metadata={metadata}
                onSearch={handleSearch}
                onError={handleError}
              />
            )}

            {searchResults.length > 0 && (
              <ResultsGrid
                results={searchResults}
                metadata={metadata}
              />
            )}

            {metadata && !searchResults.length && activeTab === 'search' && (
              <div className="empty-state">
                <div className="empty-state-icon">üîç</div>
                <h3>Ready to Search</h3>
                <p>Select object classes and configure search parameters to find matching images</p>
              </div>
            )}
          </div>
        </main>

        {/* Footer */}
        <footer className="app-footer">
          <p>Built with üíú by <a href="https://satyamkumarcode.com" className="gradient-text">Satyam Kumar</a> | Powered by YOLOv11</p>
        </footer>
      </div>
    </div>
  );
}

export default App;
